    <div>
        <h1>Ticaret Hukuku</h1>
        <p>
            Ticaret hukuku, ticari iletmelerin faaliyetlerini, kurulularn, birlemelerini, devralmalarn, tasfiyelerini ve genel olarak ticari ilikileri dzenleyen bir hukuk daldr. Bu hukuk dal, ticari hayatn dzenli ve gvenli bir ekilde yrtlmesini salamay amalar. Ticaret hukuku, irketler hukuku, rekabet hukuku, sigorta hukuku, tamaclk hukuku gibi alt dallara ayrlr.
        </p>

        <h2>irket Kuruluu ve Ynetimi</h2>
        <p>
            Ticaret hukuku, anonim, limited ve dier irket trlerinin kuruluunu, ynetimini ve tasfiyesini dzenler. Bu kapsamda, irketlerin esas szlemelerinin hazrlanmas, ticaret siciline kayt ilemleri, ynetim kurulu ve genel kurul toplantlarnn dzenlenmesi, imtiyazl pay sahiplerinin haklarnn korunmas gibi srelerde hukuki danmanlk salanr.
        </p>

        <h2>irket Birlemeleri ve Devralmalar</h2>
        <p>
            irketlerin birleme ve devralma ilemleri, irketlerin bymesi ve yeniden yaplandrlmas srelerini kapsar. Bu srete, due diligence yaplmas, ortaklk yaplarnn yeniden dzenlenmesi, birleme ve devralma ilemlerinin hukuki boyutlarnn ynetilmesi gibi konular ticaret hukuku erevesinde ele alnr.
        </p>

        <h2>Rekabet Hukuku</h2>
        <p>
            Rekabet hukuku, piyasa rekabetinin korunmas ve tekellemenin nlenmesi amacyla dzenlenmi kurallar ierir. Ticaret hukuku, irketlerin rekabet hukukuna uygun faaliyet gstermesini salamak iin danmanlk hizmeti verir. Bu kapsamda, rekabeti engelleyici anlama ve uygulamalarn tespiti, rekabet kurumu nezdinde bavurularn yaplmas, tekelleme ve piyasa hakimiyeti konularnda hukuki danmanlk verilir.
        </p>

        <h2>Ticari Szlemeler</h2>
        <p>
            Ticaret hukuku, distribtrlk, bayilik, franchise, tedarik ve hizmet szlemeleri gibi ticari szlemelerin hazrlanmasn ve bu szlemelerin yrtlmesini dzenler. Ayrca, uluslararas ticaret szlemeleri ve bu szlemelerden doan uyumazlklarn zm de ticaret hukukunun kapsamna girer.
        </p>

        <h2>Genel Olarak Hukuki Danmanlk Verdiimiz Alanlar</h2>
        <ul>
            <li>Anonim, limited ve dier irket trlerinin kuruluu, ynetimi ve tasfiyesi.</li>
            <li>irket birleme ve devralmalar, ortaklk yaplarnn yeniden dzenlenmesi, due-diligence srecinde hukuki danmanlk verilmesi.</li>
            <li>Ynetim kurulu ve genel kurul toplantlarnn dzenlenmesi, kararlarn hazrlanmas.</li>
            <li>irketlerin esas szlemelerinin ve ortaklk szlemelerinin hazrlanmas, ticaret siciline kayt yaplmas.</li>
            <li>mtiyazl pay yaratma sreci, aznlk ve imtiyazl pay sahiplerinin haklarnn korunmas.</li>
            <li>Ynetim Kurulu yelerinin ibras, sorumluluklarnn denetlenmesi.</li>
            <li>Halka alma, izahname sreci, SPK ve dier ilgili mevzuatlara uyum sreci hakknda hukuki ve ynetimsel danmanlk verilmesi.</li>
            <li>irketlerin tasfiyesi.</li>
            <li>Rekabet Hukuku kapsamnda mevzuata ve Rekabet Kurumuna uyum sreci.</li>
            <li>Rekabeti engelleyici anlama ve uygulamalarn tespiti ve nlenmesi.</li>
            <li>Tekelleme ve piyasa hakimiyeti konularnda danmanlk.</li>
            <li>Rekabet kurumu nezdinde bavurular ve savunmalarn hazrlanmas.</li>
            <li>Distribtrlk, bayilik, franchise, tedarik ve hizmet szlemeleri.</li>
            <li>Uluslararas ticaret szlemeleri ve uyumazlklarn zm.</li>
            <li>Rekabeti engelleyici anlama ve uygulamalarn tespiti ve nlenmesi.</li>
            <li>Tekelleme ve piyasa hakimiyeti konularnda danmanlk.</li>
            <li>Rekabet kurumu nezdinde bavurular ve savunmalarn hazrlanmas.</li>
        </ul>
        <p>
            Ticaret Hukukunun birok alannda faaliyet gstermekteyiz.
        </p>
    </div>
